    const [spotData, setSpotData] = useState(null);
    useEffect(() => {
        fetch("http://localhost:8080/getSpot?spot=" + spotName).then(result =>{
            console.log(result);
            setSpotData(result.json());
        }).catch(e => {
            console.log(e);
        });
    }, [getSpotData, name]);

    let plane;
    if (spotData.plane) {
        plane = (
            <Plane plane={spotData.plane} moveMode={moveMode} setMoveMode={setMoveMode} />
        );
    }
    let glow = (moveMode && !spotData.plane ? "glow" : "");
    let upperChar = name.replace("ramp-", "").toUpperCase();
    return (
        <tr id={name} className={glow} onClick={() => moveHere(name, moveMode, setMoveMode)}>
            <td>{upperChar}</td>
            <td>{plane}</td>
        </tr>
    );
}

