                        moveMode={moveMode} setMoveMode={setMoveMode} moveHere={moveHere} />
                    <TDoorsBoxItem name="t-2" data={data} updateData={updateData}
                        moveMode={moveMode} setMoveMode={setMoveMode} moveHere={moveHere} />
